        // 重たい処理なのである程度のMulti Threadを作って利用した方が良さそう
        public static string Detect(Translate translate, string text)
        {
            int engCnt = 0;
            int japaneseCnt = 0;
            int chineseCnt = 0;
            int etcCnt = 0;
            foreach (char c in text)
            {
                if (c == ' ') {
                    continue;
                }

                /******** 軽い処理を先に行う　*******/
                if (translate.NoLanguage.IsMatch(c.ToString())) {
                    continue;
                }
                // alphabet
                if ((c >= 'a' && c <= 'z') || (c >= 'A' && c <= 'Z'))
                {
                    engCnt++;
                    continue;
                }
                // ひらがな、カタカナ、国字
                if (translate.JapaneseFullWord.IsMatch(c.ToString()) || translate.HankakuKana.IsMatch(c.ToString()) || translate.JapaneseKokuji.IsMatch(c.ToString()))
                {
                    japaneseCnt+=3;
                    continue;
                }
                /**********************************/

                /******** 重たい処理　***************/
                bool isHit = false;

                // 日本語に簡体字もあるので簡体字から確認（負荷減らすため）
                if (translate.SimplifiedChinese.IsMatch(c.ToString()))
                {
                    chineseCnt++;
                    isHit = true;
                    // 簡体字は日本語の可能性もあるため確認
                    if (translate.JapaneseKanji.IsMatch(c.ToString()))
                    {
                        japaneseCnt++;
                    }
                    else
                    {
                        chineseCnt += 2;
                    }
                    continue;
                } else if (translate.Kanji.IsMatch(c.ToString())) {
                    // 繁体字は日本語の可能性もあるため確認
                    if (translate.JapaneseKanji.IsMatch(c.ToString()))
                    {
                        japaneseCnt++;
                    }
                    else
                    {
                        chineseCnt += 2;
                    }
                    chineseCnt++;
                    continue;
                }
                /**********************************/

                if (!isHit) {
                    etcCnt++;
                }
            }

            return getMaxIdx(new int[] { engCnt, chineseCnt, japaneseCnt, etcCnt });
        }

        public static string getMaxIdx(int[] data) {
            string[] resultLang = new string[]{
                "英語",
                "中国語",
                "日本語",
                "etc",
            };
            int max = 0;
            int maxIdx = -1;

            for (int idx = 0; idx < data.Length; idx++)
            {
                if (max < data[idx])
                {
                    max = data[idx];
                    maxIdx = idx;
                }
            }
            if (maxIdx == -1) {
                return "etc";
            }
            return resultLang[maxIdx];
        }
